	public boolean sendMailMultiple(String toAddress, String fromAddress,
			String subject, String htmlMessage, String ccAddress) {
		boolean flag = false;
		try {
			String to[] = toAddress.split(",");
			String cc[] = ccAddress.split(",");
			String from = fromAddress;
			String host = "172.18.8.43";
			// Setting Mail properties
			Properties props = new Properties();
			props.put("mail.smtp.host", host);
			props.put("mail.debug", "false");
			// Getting a New Instance Generated by the API
			Session session = Session.getInstance(props);
			// Instantiate a message
			Message msg = new MimeMessage(session);
			// Set message attributes
			msg.setFrom(new InternetAddress(from));

			for (int i = 0; i < to.length; i++) {
				// InternetAddress[] address = {new InternetAddress(to[i])};
				// msg.setRecipients(Message.RecipientType.TO, address);
				if (!to[i].equals("")) {
					msg.addRecipient(Message.RecipientType.TO,
							new InternetAddress(to[i], ""));
				}

			}

			for (int j = 0; j < cc.length; j++) {
				// InternetAddress[] address = {new InternetAddress(to[j])};
				// msg.setRecipients(Message.RecipientType.CC, address);

				if (!cc[j].equals("")) {

					msg.addRecipient(Message.RecipientType.CC,
							new InternetAddress(cc[j], ""));
				}
			}
			// Setting Subject Type
			msg.setSubject(subject);
			msg.setSentDate(new Date());
			// Setting Content Type
			msg.setContent(htmlMessage, "text/html");
			// msg.setContent("text/html","");
			// Set message content
			// msg.setText(htmlMessage);
			// Send the message
			Transport.send(msg);
			flag = true;
		} catch (Exception mex) {
			// Prints all nested (chained) exceptions as well
			mex.printStackTrace();
		}
		return flag;
	}

	public boolean sendMailWithAttachement(String toAddress,
			String fromAddress, String subject, String filepath, String dmsg) {
		boolean flag = false;

		try {
			String to = toAddress;
			String from = fromAddress;
			Authenticator authenticator = new Authenticator();
			String host = "172.18.16.43";
			String filename = filepath;
			// write details
			String msgText1 = dmsg;
			String subject1 = subject;
			// String subject1=subject;
			Authenticator authenticator1 = new Authenticator();
			// Setting Mail properties
			Properties props = new Properties();
			props.setProperty("mail.smtp.submitter", authenticator
					.getPasswordAuthentication().getUserName());
			props.setProperty("mail.smtp.auth", "true");
			props.setProperty("mail.smtp.port", "25");
			props.put("mail.smtp.host", host);
			props.put("mail.debug", "false");
			// Getting a New Instance Generated by the API
			Session session = Session.getInstance(props, authenticator1);
			// create a message
			MimeMessage msg = new MimeMessage(session);
			msg.setFrom(new InternetAddress(from));
			InternetAddress[] address = { new InternetAddress(to) };
			msg.setRecipients(Message.RecipientType.TO, address);
			msg.setSubject(subject1);
			// msg.setContent(dmsg,"text/html");
			// create and fill the first message part
			MimeBodyPart mbp1 = new MimeBodyPart();
			// mbp1.setText(msgText1);
			mbp1.setContent(msgText1, "text/html");
			// create the second message part
			MimeBodyPart mbp2 = new MimeBodyPart();
			// attach the file to the message
			FileDataSource fds = new FileDataSource(filename);
			mbp2.setDataHandler(new DataHandler(fds));
			mbp2.setFileName(fds.getName());
			// create the Multipart and add its parts to it
			Multipart mp = new MimeMultipart();
			mp.addBodyPart(mbp1);
			mp.addBodyPart(mbp2);
			// add the Multipart to the message
			msg.setContent(mp);
			// set the Date: header
			msg.setSentDate(new Date());

			// send the message
			Transport.send(msg);

			flag = true;
		} catch (Exception mex) {
			// Prints all nested (chained) exceptions as well
			mex.printStackTrace();
		}
		return flag;
	}
	
